.user-contents h2,
.user-contents h3,
.user-contents h4,
.user-contents h5,
.user-contents h6,
.user-contents p,
.user-contents dl,
.user-contents blockquote,
.user-contents code,
.user-contents ol,
.user-contents ul {
    margin-bottom: 12px;
    margin-top: 12px;
}
.user-contents h1,
.user-contents h2,
.user-contents h3,
.user-contents h4,
.user-contents h5,
.user-contents h6 {
    hyphens: none;
    line-height: 1.5em;
    font-size: 1em;
}
.user-contents h1 {
    font-size: 1.4em;
    font-weight: 700;
}
.user-contents h2 {
    font-size: 1.3em;
    font-weight: 700;
}
.user-contents h3 {
    font-size: 1.2em;
    font-weight: 700;
}
.user-contents h4 {
    font-size: 1.1em;
    font-weight: 400;
    font-style: italic;
}
.user-contents h5 {
    font-size: 1.1em;
    font-weight: 400;
    font-variant: small-caps;
}
.user-contents h6 {
    font-size: 1.1em;
    font-weight: 400;
    text-decoration: underline;
}
.article-body h1:not(:empty):before {
    counter-increment: heading;
    /* add 1 to heading */
    
    content: counter(heading) " ";
    width: 2em;
    display: inline-block;
}
.article-body h1:not(:empty) {
    counter-reset: subheading section;
    /* set section to 0 */
}
.article-body h2:not(:empty):before {
    content: counter(heading) "." counter(subheading) " ";
    counter-increment: subheading subsection;
    width: 2em;
    display: inline-block;
}
.article-body h2:not(:empty) {
    counter-reset: section;
}
.article-body h3:not(:empty):before {
    content: counter(heading) "." counter(subheading) "." counter(section) " ";
    counter-increment: section;
    width: 2em;
    display: inline-block;
}
.article-body h3:not(:empty) {
    counter-reset: subsection;
}
div#print .article-body,
.pagination-footnote > * > * {
    font-size: 1em;
}
/*unordered lists (<ul>) - the list items are marked with bullets*/
/*ordered lists (<ol>) - the list items are marked with numbers or letters*/
/*Anything added to the <ol> or <ul> tag, affects the entire list, while properties added to the <li> tag will affect the individual list items*/

.user-contents p,
.user-contents ol li,
.user-contents ul li {
    font-size: 1em;
    margin: auto;
    line-height: 1.4em;
    text-indent: 0;
    margin-block-start: 7px;
    margin-inline-start: 5px;
}
.user-contents strong {
    font-weight: 700;
}
.user-contents em {
    font-style: italic;
}
.user-contents ul,
.user-contents ol {
    padding-left: 15px;
}
.user-contents ul {
    list-style: disc;
    /*A filled circle*/
}
.user-contents ol {
    list-style: decimal;
}
.user-contents blockquote {
    font-style: italic;
    margin-left: 10px;
    margin-right: 10px;
    font-size: 2.2em;
    line-height: 2.3em;
}
.user-contents code {
    display: block;
    font-family: "Courier New", Courier, mono-space;
    font-size: 1.3em;
    line-height: 1.75em;
}
#flow .article-bibliography {
    background-color: lightgrey;
}
#flow .article-bibliography p {
    font-size: 1.4em;
    margin-bottom: 18px;
}
#flow .article-bibliography ol li {
    counter-increment: list-order;
    list-style-position: outside;
    list-style-type: none;
    margin-left: 1.1em;
    font-size: 0.923em;
}
.equation {
    margin: 3pt 0;
    align-items: center;
    justify-content: center;
    font-size: 1.3em;
}
.pagination-page .pagination-main-contents-container {
    height: 957px;
}
div#print table {
    border-collapse: initial;
    border-spacing: initial;
    margin-bottom: 10px;
}
div#print tr,
div#print td {
    padding: 4px;
    border: 1px solid black;
}
div#print figure {
    margin: 0 0 10px 0;
}

